import React from "react";
import { NavLink } from "react-router-dom";

const Menu = () => {
  return (
    <header>
      Our Top Rated Movies List
      <nav>
        <ul>
          <li>
            <NavLink to="/Home">Home</NavLink>
          </li>
          <li>
            <NavLink to="/MovieList">Movie List</NavLink>
          </li>
          <li>
            <NavLink to="/MovieList/LikeMovieList">Like Movie List</NavLink>
          </li>
          <li>
            <NavLink to="/MovieList/BlockedMovieList">
              Blocked Movie List
            </NavLink>
          </li>
        </ul>
      </nav>
    </header>
  );
};

export default Menu;
